import React from 'react';
import ReactDOM from 'react-dom/client';
import { Header } from './pages/layout/header';
import {SearchBar} from './components/search';
import App from './App';  

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <div class="banner">
    <div class="container">
      <Header />
      <SearchBar />
    </div>
  </div>
);
